import JCronModal from "./modal/JCronModal";
export default {
  name: 'JCron',
  components: {
    JCronModal: JCronModal
  },
  props: {
    value: {
      required: false,
      type: String
    }
  },
  data: function data() {
    return {
      cron: this.value
    };
  },
  watch: {
    value: function value(val) {
      this.cron = val;
    }
  },
  methods: {
    openModal: function openModal() {
      this.$refs.innerVueCron.show();
    },
    handleOK: function handleOK(val) {
      this.cron = val;
      this.$emit("change", this.cron); //this.$emit("change", Object.assign({},  this.cron));
    },
    handleEmpty: function handleEmpty() {
      this.handleOK('');
    }
  },
  model: {
    prop: 'value',
    event: 'change'
  }
};
